import React, {useEffect, useState} from 'react'
import { Table, InputGroup, Form, Container } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App(){
  const [search, setSearch] = useState('')
  const [backendData, setBackendData] = useState([])

  useEffect(() => {
    fetch("/api")
      .then(response => {
        return response.json()
      })
      .then(data => {
        setBackendData(data)
      })
  }, [])

  return (
    <Container>
      <h1 className='text-center mt-4'>Powerlifting Meets</h1>
      <Form>
        <InputGroup className='my-3'>
          <Form.Control onChange={(e) => setSearch(e.target.value)} placeholder='filter events'></Form.Control>
        </InputGroup>
      </Form>
      <Table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Event Details</th>
            <th>When</th>
            <th>Where</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Santa Cruz Ball</td>
            <td>lifting with 60 people</td>
            <td>March 13, 2023</td>
            <td>Santa Cruz, CA</td>
          </tr>
        </tbody>
      </Table>
    </Container>
  )
}


export default App
